class ResumeForm extends Component {

    constructor(){
        super()
        this.state = {

            personal_info: '',
            work_history: '',
            education: '',
            skills: ''
        }
    }


    render() {
        return (
            <div>
                <h1>Create A New Resume!</h1>
            </div>
        );
    }
}

export default ResumeForm;
